// 字典配置文件
const dictConfig = {
  // 当前状态字典
  status: [
    '未开始',
    '进行中',
    '已完成'
  ],
  
  // 优先级字典
  priority: [
    '高',
    '中',
    '低'
  ],
  
  // 责任人字典
  responsiblePerson: [
    '杨慧强',
    '金开拓',
    '田亮',
    '巩雪芳',
    '刘庭俊',
    '温晓军'
  ]
};

export default dictConfig;
